void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;
    float time = iTime;
    float a = sin(uv.x*700.0 + 5.123*time)*0.005;
    float u = sin(uv.x*2.321 + time)*1.2;
    float k = sin(uv.x*30.0 + time)*0.05;
    float q = sin(uv.x*10.0 + time*-2.321)*.7;
    float v = sin(uv.x*1.0 + time*1.321)*0.7;
    q*=v;
    float x2 = uv.x*5.0 - time;    
    float m2= uv.y*5.0-3.0;    
    float k2 = step(sin(x2),m2+k+q+a+u);    
    fragColor = vec4(k2);
}
